import React from "react";
import Card from "./Cards";
import Sdata from "./Sdata";

const favSeries = "netflix";

const FavS = () => {
    if (favSeries === "netflix") {
        return (
            <Card
                key={Sdata[5].id}
                imgsrc={Sdata[5].imgsrc}
                title={Sdata[5].title}
                sname={Sdata[5].sname}
                link={Sdata[5].links}
            />
        );
    }
    else {
    
        return (
            <Card
                key={Sdata[[5]].id}
                imgsrc={Sdata[[5]].imgsrc}
                title={Sdata[[5]].title}
                sname={Sdata[[5]].sname}
                link={Sdata[[5]].links}
            />
        );


    }
}

// "props (which stands for propertties). react props are like function arguments in javascript."

const App1 = () => (
    <>
        <h1 className="heading_style"> List Of Top Six Amazon Prime  Series</h1>
      <FavS />
    </>

);

export default App1;
